import React from 'react'

const Top5PerMonth = ({ top5PerMonth }) => {
    return (
        <div>
            <center><h1>Top 5 Per Month</h1></center>
            <div>
                {top5PerMonth["1.1970"].map((key, value) => (
                    <p>{key} {value}</p>
                ))}
            </div>
        </div>
    )
};

export default Top5PerMonth
